import React from "react";
import Item from "./Item"
import CustomButton from "./UI/button/CustomButton";

const ItemList = ({datas, label}) => {
    return(
        <div>
            <h1 style={{textAlign: "center"}}>{label}</h1>

            <form>
                <input placeholder="Technology name" type="text"></input>
                <input placeholder="Description" type="text"></input>
                <CustomButton>Add technology</CustomButton>
            </form>

            <div>
            { datas.map((data) => 
            <Item data={data} key={data.id}/>) }

            </div>

        </div>

    )

}

export default ItemList;
